script: |
  super -f text -I q11425.spq | sort > q11425.out

inputs:
  - name: q11425.spq
    data: |
      SELECT - ( - col1 ) FROM tab0 (FORMAT parquet) AS cor0 WHERE - 59 + + col2 * 81 + + 35 NOT BETWEEN NULL AND + + col0;
  - name: tab0

outputs:
  - name: q11425.out
    data: |
      1
      21
      81
